#!/usr/bin/env node

"use strict"





var pages         = require('engram/es5/pages')
var publicFiles   = require('engram/es5/public-files')





{
	var dependencies = { }

	dependencies['javascript-head']   = publicFiles.loadJS([ ])
	dependencies['javascript-bottom'] = publicFiles.loadJS([

		'lib-jquery',
		'lib-mustache',
		'lib-is',
		'lib-require',

		'pubsub',
		'message',
		'engram',
		'cache',

		'routes/uri',
		'routes/router',
		'routes/uri-iterator',
		'routes/use',
		'routes',

		'listeners',
		'update-query',
		'update-time',
		'sync-bookmarks',
		'delete-bookmark',
		'draw-bookmarks',
		'import-bookmarks',
		'search',
		'list-bookmarks',
		'main'

	])

	dependencies.css = publicFiles.loadCSS([
		'style'
	])


}





module.exports = ( ) => {
	return pages.index(dependencies)
}
